import React, { Component } from 'react'
import axios from 'axios'
export default class Register extends Component {
  constructor(props) {
    super(props)
    this.state = {
      username : '',
      password: '',
      first_name: '',
      last_name: '',
      email: '',
      phone_number: '',
      credit_card: ''
    };
  }
  handleInputChange = (event) => {
    const { value, name } = event.target;
    this.setState({
      [name]: value
    });
